import React, { Component } from "react";
import styled from 'styled-components';

const BgImgStyled = styled.img`
    width: 100%;
    height: 200px;
    overflow: hidden;
`;

class BgImg extends Component {
    render() {
        return (
            <BgImgStyled src="/img/bgimg.jpg" alt="Img" />

        )
    }
}

export default BgImg;
